import React from 'react';
import logo from './logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="App-logo" />

        <p></p><p></p><p></p>
        <button className="HomeButton" onClick={console.log("button clicked")}>enter >>></button>

      </header>
    </div>
  );
}

export default App;
